import React, { Component } from 'react'
import axios from 'axios'

class Postform extends Component {
  constructor(props){
    super(props)
    this.state = {
      userId:  '',
      title : '',
      body: ''
    }
    
  }
  changeHalder = e =>{
    this.setState({[e.target.name]:e.target.value})
  }

  changeHalder = e =>{
    e.preventDefault()
    console.log(this.state)
    axios.post("http://localhost:8080/register",this.state)
    .then(response =>{
    console.log(response)
    }).catch(error=>{
      console.log(error)
    })
  }
  
  render() {
    const {userId,title,body} = this.state
    return (
      <div>
        <form onSubmit={this.submitHandler}>
          <div>
            <input type="text" id="name" name="name" values = {userId} onChange={this.onChangeHandler}/>
          </div>
          <div>
            <input type="text" id="name" name="name" values = {title}  onChange={this.onChangeHandler}/>
          </div>
          <div>
            <input type="text" id="name" name="name"values = {body}  onChange={this.onChangeHandler}/>
          </div>
        </form>
        <button type ="submit"> submit </button>
      </div>
    )
  }
}

export default Postform
